describe('Run', () => {
    for (const [input, output] of runTests.entries()) {
        const puzzle = input[0];
        const solution = input[1] ?? '()';
        it(`${puzzle} with ${solution}`, () => {
            const cost = input[2];
            const strict = input[3];
            if (output === null) {
                expect(() => {
                    const puzzleProgram = Program.fromSource(puzzle);
                    const solutionProgram = Program.fromSource(solution);
                    puzzleProgram.run(solutionProgram, {
                        maxCost: cost,
                        strict,
                    });
                }).to.throw();
            } else {
                const puzzleProgram = Program.fromSource(puzzle);
                const solutionProgram = Program.fromSource(solution);
                const result = puzzleProgram.run(solutionProgram, {
                    maxCost: cost,
                    strict,
                });
                const text =
                    output[2] ?? false
                        ? result.value.serializeHex()
                        : result.value.toSource(output[3]);
                assert.equal(text, output[0], 'Wrong output.');
                if (output[1] !== undefined)
                    assert.equal(result.cost, output[1] - 9n, 'Wrong cost.');
            }
        });
    }
});
